import React from 'react';
class ListarPokemon extends  React.Component {
    constructor(props){
        super(props);

        this.state = {
            content: ''
        }
    }

    render() {
        if(this.props.encontrado){
            return(
                this.props.resutado.map( (pokemon) => {
                    <div>
                        <h4>Nombre: {pokemon.name}</h4>
                        <h5>Id: {pokemon.id}</h5>  
                        <img 
                            src = {pokemon.sprites.front_default} 
                            alt = {pokemon.name} 
                        />
                </div>

                })
            );
        }
        return(
            <div>
            </div>
        );
    };

}
export default ListarPokemon;
